        public class Solution
        {
            // 这是第一次做的答案，算法是错的。比如dvdf，找到d的时候，虽然在hashset中有，但是要回溯到v开始重新计数
            public int LengthOfLongestSubstring_error(string s)
            {
                HashSet<Char> subChars = new HashSet<char>();
                int maxSubLength = 0;
                int count = s.Length;
                for (int i = 0; i < count; ++i)
                {
                    var c = s[i];                   
                    if (subChars.Contains(c))
                    {
                        maxSubLength = Math.Max(maxSubLength, subChars.Count);
                        subChars.Clear();
                        subChars.Add(c);
                    }
                    else
                    {
                        subChars.Add(c);
                    }
                }

                maxSubLength = Math.Max(maxSubLength, subChars.Count);

                return maxSubLength;           
            }

            // 这个算法正确了，但是提示时间超限制了Time Limit Exceeded
            public int LengthOfLongestSubstring_TLE(string s)
            {
                // key是字符串，value是索引位置
                Dictionary<Char, int> noRepeatMap = new Dictionary<char, int>();
                int maxSubLength = 0;
                int count = s.Length;
                for (int i = 0; i < count; ++i)
                {
                    var c = s[i];
                    int findRepeateIndex;
                 
                    if (noRepeatMap.TryGetValue(c,out findRepeateIndex))
                    {
                        maxSubLength = Math.Max(maxSubLength, noRepeatMap.Count);

                        // 重新构造记录字符串的map
                        noRepeatMap.Clear();
                        for (int j = findRepeateIndex + 1; j <= i; ++j)
                        {
                            noRepeatMap.Add(s[j],j);
                        }                       
                    }
                    else
                    {
                        noRepeatMap.Add(c, i);
                    }
                }

                // 考虑到字符串结尾也没有重复的情况
                maxSubLength = Math.Max(maxSubLength, noRepeatMap.Count);

                return maxSubLength;           
            }

            // 重新考虑算法。当发现一个重复的字符时，下个字串的开始位置从重复字符的下一个开始计算，同时要更新搜索map中待查字符的位置
            // 下面的代码提交成功了，但是beats 20% . 性能太差了 。但是这个算法是O(n)的啊。难道是可以提前跳出？
            // 加上提前跳出，提高到了50%左右的位置
            public int LengthOfLongestSubstring_Map(string s)
            {
                // key是字符串，value是索引位置
                Dictionary<Char, int> noRepeatMap = new Dictionary<char, int>();

                // 字符串开始的位置
                int subBegin = 0;

                // 当前的最大计数
                int maxSubLength = 0;
            
                int count = s.Length;
                for (int i = 0; i < count; ++i)
                {
                    // 加上跳出判断后，到达47.19%的位置
                    if (maxSubLength >= (count - subBegin))
                    {
                        return maxSubLength;
                    }

                    var c = s[i];
                    int findRepeateIndex;

                    if (noRepeatMap.TryGetValue(c, out findRepeateIndex))
                    {

                        if (findRepeateIndex >= subBegin)
                        {
                            // 在当前子串的范围内，找到了重复的字符

                            // 更新最大不重复子串的长度
                            maxSubLength = Math.Max(maxSubLength, i - subBegin);

                            // 更新子串的开始位置和字符的判断位置
                            subBegin = findRepeateIndex + 1;
                            noRepeatMap[c] = i;
                        }
                        else
                        { 
                            // 在当前子串之前，更新位置字符位置
                            noRepeatMap[c] = i;
                        }
                    }
                    else
                    {
                        noRepeatMap.Add(c, i);
                    }
                }

                // 考虑到字符串结尾也没有重复的情况
                maxSubLength = Math.Max(maxSubLength, count - subBegin);

                return maxSubLength;
            }


            // 把hashmap变成数组。本来也是想这样试试，后来看过书上答案也是数组实现.书上的答案只考虑的26个字母，是有问题的。
            // 竟然告诉我Time Limit Exceeded。我觉得这个代码应该比LengthOfLongestSubstring_Map快啊！
            // 然后我把数组大小修改为256，ok了。beats 95.05%。 我觉得这个改法好无聊。而且我提交了三次，beats的比例都不一样，最低70%多，最高到96%了。看来和当时CPU的运行效率有关。

            public int LengthOfLongestSubstring(string s)
            {
                // 为了避免一次赋值操作。noRepeatMap记录的字符串的字符索引从1开始计数。而默认值0表示没有被访问过
               // int[] noRepeatMap = new int[System.UInt16.MaxValue + 1];

                // 修改成256之后，代码效率提到
                int[] noRepeatMap = new int[256];


                // 字符串开始的位置
                int subBegin = 0;

                // 当前的最大计数
                int maxSubLength = 0;

                int count = s.Length;
                for (int i = 0; i < count; ++i)
                {
                    // 加上跳出判断后，到达47.19%的位置
                    if (maxSubLength >= (count - subBegin))
                    {
                        return maxSubLength;
                    }

                    System.UInt16 c = (System.UInt16)s[i];

                    int findRepeateIndex = noRepeatMap[c]-1;

                    if (findRepeateIndex >= subBegin)
                    {
                        // 在当前子串的范围内，找到了重复的字符

                        // 更新最大不重复子串的长度
                        maxSubLength = Math.Max(maxSubLength, i - subBegin);

                        // 更新子串的开始位置和字符的判断位置
                        subBegin = findRepeateIndex + 1;
                    }
                
                    noRepeatMap[c] = i + 1;
                }

                // 考虑到字符串结尾也没有重复的情况
                maxSubLength = Math.Max(maxSubLength, count - subBegin);

                return maxSubLength;

            }
        }

